import { Injectable } from '@angular/core';
import { Car } from './car';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  private cars: Car[] = [
    { name: 'Carro 1', licence: 'ABC123', deleted: false },
    { name: 'Carro 2', licence: 'DEF456', deleted: false },
    { name: 'Carro 3', licence: 'GHI789', deleted: true },
    { name: 'Carro 4', licence: 'JKL012', deleted: true },
    { name: 'Carro 5', licence: 'MNO345', deleted: true }
  ];

  constructor() { }

  getCars(): Car[] {
    return this.cars;
  }

  getDeletedCars(): Car[] {
    return this.cars.filter(car => car.deleted);
  }
  getHistoricoDeletados(): Car[] {
    return this.cars.filter(car => car.deleted);
  }
}
